import React from "react";

function CopyInput({ text }) {
    function copyText() {
        const input = document.getElementById("myInput");
        input.select();
        document.execCommand("copy");
        alert("Почта скопирована")
    }

    return (
        <input
            type="text"
            value={text}
            id="myInput"
            onClick={copyText}
            readOnly
        />
    );
}

export default CopyInput;
